--
-- Table structure for table `sale`
--

CREATE TABLE `sale` (
  `sale_id` int(11) NOT NULL,
  `sale_code` varchar(20) NOT NULL DEFAULT '-',
  `isreturn` tinyint(2) DEFAULT '0',
  `currency_id` varchar(10) NOT NULL DEFAULT '-',
  `rate` decimal(15,4) NOT NULL DEFAULT '1.0000',
  `businesspartner_id` int(11) NOT NULL,
  `general_journal_id` int(11) NOT NULL,
  `inventoryledger_link_id` int(11) NOT NULL,
  `branch_id` int(11) NOT NULL,
  `warehouse_id` int(11) NOT NULL,
  `transaction_date` datetime NOT NULL,
  `description` varchar(150) NOT NULL DEFAULT '-',
  `discount_amount` decimal(15,4) NOT NULL DEFAULT '0.0000',
  `discount_persent` decimal(15,4) NOT NULL DEFAULT '0.0000',
  `tax_id` int(11) NOT NULL,
  `landed_cost` decimal(15,4) NOT NULL DEFAULT '0.0000',
  `detail_landed_cost` decimal(15,4) NOT NULL DEFAULT '0.0000',
  `salesman_id` int(11) NOT NULL,
  `delivery_address` varchar(150) NOT NULL DEFAULT '-',
